import { makeStyles, Theme } from "@material-ui/core/styles";

const useStyles = makeStyles((theme: Theme) => ({
    actionButtons: {
        display: "flex",
        flexDirection: "row",
        alignItems: "center",
        justifyContent: "space-between",
        width: "100%",
        "&>button": {
            background: "none",
            border: "none",
            cursor: "pointer",
            outline: "none"
        }
    },
    headerLoginWrapper: {
        position: "absolute",
        width: "95%",
        top: "15px",



    }

}));

export default useStyles;
